function MobileMenu({signOut, isOpen}){
    return(
        <div className={`mobile-menu ${isOpen ? mobile-menu_active : ''}`}>
          <Link className="header__link opacity-button" to="/sign-in" onClick={signOut}>Выйти</Link>
        </div>
    )
}

export default MobileMenu;
